// CommunityPage.js
import React from 'react';
import CreatePost from './CreatePost';  // Optional: top of the page
import PostList from './PostList';      // Displays all posts

const CommunityPage = () => {
  return (
    <div>
      <h1>Community Feed</h1>
      <CreatePost />
      <PostList />
    </div>
  );
};

export default CommunityPage;
